import { createSignal } from "solid-js";
import { A, Title } from "solid-start";

export default function Signup() {
  const [username, setName] = createSignal("");
  const [email, setEmail] = createSignal("");
  const [password, setPassword] = createSignal("");
  const [confirmpassword, setConfirmPassword] = createSignal("");
  const [formData, setFormData] = createSignal({ username: '', email: '' ,password:'',confirmpassword:''});

  const handleNameChange = (event: { target: { value: any } }) => {
    setName(event.target.value);
  };
  const handleEmailChange = (event: { target: { value: any } }) => {
    setEmail(event.target.value);
  };

  const handlePasswordChange = (event: { target: { value: any } }) => {
    setPassword(event.target.value);
  };

  const handleConfirmPasswordChange = (event: { target: { value: any } }) => {
    setConfirmPassword(event.target.value);
  };

  const handleSubmit = async (event: { preventDefault: () => void }) => {
    event.preventDefault();
    try {
      const url = 'http://localhost:5000/user/create/'; 
    
      const data = await postData(url, formData());
      if(data.status==200){
        console.log(data)
        // const url = 'http://localhost:5000/user/create/'; 
    
        // const data = await postData(url, formData());

      }
      
    } catch (error) {
      console.error('Error:', error);
    }

    // const data = { name: name(), email: email(), password: password() };
    // console.log(data);
  };
  async function postData(url:any, data:any) {
   
    const response = await fetch(url, {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      
      },
      body: JSON.stringify(data),
    });
    return response.json();
  }
  return (
    <main>
      <Title>Auth</Title>
      <section class="bg-gray-50 dark:bg-black">
        <div class="flex flex-col items-center justify-center px-6 py-8 mx-auto md:h-screen lg:py-0">
          <a
            href="#"
            class="flex items-center mb-6 text-2xl font-semibold text-gray-900 dark:text-white"
          >
            {/* <img class="w-8 h-8 mr-2" src="https://flowbite.s3.amazonaws.com/blocks/marketing-ui/logo.svg" alt="logo"/> */}
            Wraptron
          </a>
          <div class="w-full bg-white rounded-lg shadow dark:border md:mt-0 sm:max-w-md xl:p-0 dark:bg-gray-800 dark:border-gray-700 text-start">
            <div class="p-6 space-y-4 md:space-y-6 sm:p-8 ">
              <h1 class="text-xl font-bold leading-tight tracking-tight text-gray-900 md:text-2xl my-8   dark:text-white ">
                Create an account
              </h1>
              <form
                class="space-y-4 md:space-y-6 "
                action="#"
                onSubmit={handleSubmit}
              >
                <div>
                  <label
                    for="name"
                    class="block mb-2 text-sm font-medium text-gray-900 dark:text-white"
                  >
                    Your name
                  </label>
                  <input
                    type="username"
                    name="username"
                    value={formData().username} onInput={(e) => setFormData({ ...formData(), username: e.target.value })}
                 
                    id="name"
                    class="bg-gray-50 border border-gray-300 text-gray-900 sm:text-sm rounded-lg focus:ring-primary-600 focus:border-primary-600 block w-full p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500"
                    placeholder="Akash Kanna"
                  />
                </div>
                <div>
                  <label
                    for="email"
                    class="block mb-2 text-sm font-medium text-gray-900 dark:text-white"
                  >
                    Your email
                  </label>
                  <input
                    type="email"
                    name="email"
                    value={formData().email} onInput={(e) => setFormData({ ...formData(), email: e.target.value })}
                    id="email"
                    class="bg-gray-50 border border-gray-300 text-gray-900 sm:text-sm rounded-lg focus:ring-primary-600 focus:border-primary-600 block w-full p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500"
                    placeholder="name@company.com"
                  />
                </div>
                <div>
                  <label
                    for="password"
                    class="block mb-2 text-sm font-medium text-gray-900 dark:text-white"
                  >
                    Password
